var provinces = {};
provinces.items = [
    {
        nom: "Nord-Kivu",
        url: "nordkivu",
        image: "data:image/png;base64,"
    },
    {
        nom: "Katanga",
        url: "katanga",
        image: "data:image/png;base64,"
    },
    {
        nom: "Kinshasa",
        url: "kinshasa",
        image: "data:image/png;base64,"
    },
];
provinces.chercherProvince = function(url) {
    for (var i = 0; i < this.items.length; i++) {
        if (this.items[i].url === url) {
            return this.items[i];
        }
    }
};